import React, { useState } from 'react';
import iconPrice from '../../assets/iconprice.svg';
import './DishOrder.css';

interface IOrderDishes {
	id: number;
	name: string;
	price: number;
	img: string;
	dishtitle: string;
	comment: string;
	quantity: number;
}

const DishOrder: React.FC<IOrderDishes> = (props: IOrderDishes) => {
	const { img, name, price, dishtitle, comment, quantity } = props;

	return (
		<>
			<div className={dishtitle}>
				<img
					className="dish-img"
					alt="dish"
					src={img}
				/>
				<div id={'name-container'}>
					<div className="dish-name">{name}</div>
					<div id="counter-dishes">{quantity}</div>
				</div>
				<div id="price-container">
					<div id="price-with-icon">
						<img
							src={iconPrice}
							id="icon-price"></img>
						<div>{price}</div>
					</div>
					<div className="description">{comment}</div>
					<div id="price-with-icon">
						<img
							src={iconPrice}
							id="icon-price"></img>
						<div>{price}</div>
					</div>
				</div>
			</div>
		</>
	);
};

export default DishOrder;
